import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Home extends Component {
  render() {
    return (
      <div className="homeContainer">
        <div>
          <h1>
            <a>DINO DISCORD</a>
          </h1>
        </div>
        <Link to="/intro">
          <a className="adventure btnHome">Begin the adventure</a>
        </Link>
        <Link to="/signin">
          <a className="iknow btnHome">I've been here before</a>
        </Link>
      </div>
    );
  }
}
